  // Ğ¤ÑƒĞ½ĞºÑ†Ğ¸Ñ Ğ´Ğ»Ñ Ğ¿Ñ€Ğ¾Ğ²ĞµÑ€ĞºĞ¸ Ñ‚Ğ¾Ğ³Ğ¾, ÑĞ²Ğ»ÑĞµÑ‚ÑÑ Ğ»Ğ¸ ÑƒĞ·ĞµĞ» ĞºÑ€Ğ°ÑĞ½Ğ¾Ğ³Ğ¾ Ñ†Ğ²ĞµÑ‚Ğ° Ğ¸Ğ»Ğ¸ Ğ½ĞµÑ‚.
  boolean isRed(node myNode) {
    if (myNode == null) {
      return false;
    }
    return (myNode.color == true);
  }

  // Ğ¤ÑƒĞ½ĞºÑ†Ğ¸Ñ Ğ´Ğ»Ñ Ğ¸Ğ·Ğ¼ĞµĞ½ĞµĞ½Ğ¸Ñ Ñ†Ğ²ĞµÑ‚Ğ° Ğ´Ğ²ÑƒÑ… ÑƒĞ·Ğ»Ñ‹.
  void swapColors(node node1, node node2) {
    boolean temp = node1.color;
    node1.color = node2.color;
    node2.color = temp;
  }

  // Ğ²ÑÑ‚Ğ°Ğ²ĞºĞ° Ğ² Ğ»ĞµĞ²Ğ¾ÑÑ‚Ğ¾Ñ€Ğ¾Ğ½Ğ½ĞµĞµ ĞšÑ€Ğ°ÑĞ½Ğ¾-Ñ‡ĞµÑ€Ğ½Ğ¾Ğµ Ğ´ĞµÑ€ĞµĞ²Ğ¾.
  node insert(node myNode, int data) {
// ĞĞ±Ñ‹Ñ‡Ğ½Ñ‹Ğ¹ ĞºĞ¾Ğ´ Ğ²ÑÑ‚Ğ°Ğ²ĞºĞ¸ Ğ´Ğ»Ñ Ğ»ÑĞ±Ğ¾Ğ³Ğ¾ Ğ´Ğ²Ğ¾Ğ¸Ñ‡Ğ½Ğ¾Ğ³Ğ¾ Ñ„Ğ°Ğ¹Ğ»Ğ°
    if (myNode == null) {
      return new node(data);
    }

    if (data < myNode.data) {
      myNode.left = insert(myNode.left, data);
    } else if (data > myNode.data) {
      myNode.right = insert(myNode.right, data);
    } else {
      return myNode;
    }

// ÑĞ»ÑƒÑ‡Ğ°Ğ¹ 1.
    // ĞºĞ¾Ğ³Ğ´Ğ° Ğ¿Ñ€Ğ°Ğ²Ñ‹Ğ¹ Ğ´Ğ¾Ñ‡ĞµÑ€Ğ½Ğ¸Ğ¹ ÑĞ»ĞµĞ¼ĞµĞ½Ñ‚ ĞºÑ€Ğ°ÑĞ½Ñ‹Ğ¹, Ğ° Ğ»ĞµĞ²Ñ‹Ğ¹ Ğ´Ğ¾Ñ‡ĞµÑ€Ğ½Ğ¸Ğ¹ ÑĞ»ĞµĞ¼ĞµĞ½Ñ‚ Ñ‡ĞµÑ€Ğ½Ñ‹Ğ¹ Ğ¸Ğ»Ğ¸ Ğ½Ğµ ÑÑƒÑ‰ĞµÑÑ‚Ğ²ÑƒĞµÑ‚.
    if (isRed(myNode.right) && !isRed(myNode.left)) {
// ĞŸĞ¾Ğ²ĞµÑ€Ğ½ÑƒÑ‚ÑŒ ÑƒĞ·ĞµĞ»  Ğ²Ğ»ĞµĞ²Ğ¾
      myNode = rotateLeft(myNode);

// ĞŸĞ¾Ğ¼ĞµĞ½ÑÑ‚ÑŒ Ğ¼ĞµÑÑ‚Ğ°Ğ¼Ğ¸ Ñ†Ğ²ĞµÑ‚Ğ° Ğ´Ğ¾Ñ‡ĞµÑ€Ğ½ĞµĞ³Ğ¾ ÑƒĞ·Ğ»Ğ° Ğ²ÑĞµĞ³Ğ´Ğ° Ğ´Ğ¾Ğ»Ğ¶ĞµĞ½ Ğ±Ñ‹Ñ‚ÑŒ ĞºÑ€Ğ°ÑĞ½Ñ‹Ğ¼
      swapColors(myNode, myNode.left);
    }

// ÑĞ»ÑƒÑ‡Ğ°Ğ¹ 2
    // ĞºĞ¾Ğ³Ğ´Ğ° Ğ»ĞµĞ²Ñ‹Ğ¹ Ñ€ĞµĞ±ĞµĞ½Ğ¾Ğº, Ğ° Ñ‚Ğ°ĞºĞ¶Ğµ Ğ»ĞµĞ²Ñ‹Ğ¹ Ğ²Ğ½ÑƒĞº Ğ²Ñ‹Ğ´ĞµĞ»ĞµĞ½Ñ‹ ĞºÑ€Ğ°ÑĞ½Ñ‹Ğ¼ Ñ†Ğ²ĞµÑ‚Ğ¾Ğ¼
    if (isRed(myNode.left) && isRed(myNode.left.left)) {
// ĞŸĞ¾Ğ²ĞµÑ€Ğ½ÑƒÑ‚ÑŒ ÑƒĞ·ĞµĞ» Ğ² Ğ¿Ñ€Ğ°Ğ²Ğ¾
      myNode = rotateRight(myNode);
      swapColors(myNode, myNode.right);
    }

// ÑĞ»ÑƒÑ‡Ğ°Ğ¹ 3
    // ĞºĞ¾Ğ³Ğ´Ğ° Ğ¸ Ğ»ĞµĞ²Ñ‹Ğ¹, Ğ¸ Ğ¿Ñ€Ğ°Ğ²Ñ‹Ğ¹ Ğ´Ğ¾Ñ‡ĞµÑ€Ğ½Ğ¸Ğµ ÑĞ»ĞµĞ¼ĞµĞ½Ñ‚Ñ‹ Ğ¾ĞºÑ€Ğ°ÑˆĞµĞ½Ñ‹ Ğ² ĞºÑ€Ğ°ÑĞ½Ñ‹Ğ¹ Ñ†Ğ²ĞµÑ‚.
    if (isRed(myNode.left) && isRed(myNode.right)) {
// Ğ˜Ğ½Ğ²ĞµÑ€Ñ‚Ğ¸Ñ€Ğ¾Ğ²Ğ°Ñ‚ÑŒ Ñ†Ğ²ĞµÑ‚ ÑƒĞ·Ğ»Ğ° ÑÑ‚Ğ¾ Ğ»ĞµĞ²Ñ‹Ğ¹ Ğ¸ Ğ¿Ñ€Ğ°Ğ²Ñ‹Ğ¹ Ğ´ĞµÑ‚Ğ¸.
      myNode.color = !myNode.color;

// Ğ˜Ğ·Ğ¼ĞµĞ½Ğ¸Ñ‚ÑŒ Ñ†Ğ²ĞµÑ‚ Ğ½Ğ° Ñ‡ĞµÑ€Ğ½Ñ‹Ğ¹.
      myNode.left.color = false;
      myNode.right.color = false;
    }

    return myNode;
  }

  // ĞĞ±Ñ…Ğ¾Ğ´ Ğ¿Ğ¾ Ğ¿Ğ¾Ñ€ÑĞ´ĞºÑƒ
  void inorder(node node) {
    if (node != null)
    {
      inorder(node.left);
      char c = 'â—';
      if (node.color == false)
        c = 'â—¯';
